// Sidebar.js
import React from 'react';
import { Link } from 'react-router-dom';

const collections = [
  'Dashboard',
  'Temperature',
  'Pressure',
  'Color',
  'FreezingPoint',
  'MeltingPoint',
  'Location',
  'Quantity',
  'RainRate',
  'Size',
  'WeightGrams',
];

function Sidebar() {
  return (
    <div className="sidebar">
      <h2>Sidebar</h2>
      <ul>
        {collections.map((collectionName) => (
          <li key={collectionName}>
            <Link to={`/${collectionName.toLowerCase()}`}>{collectionName}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Sidebar;
